- input: "TEXT\x1CC00485821\x1CT1\x1C\x1CF3XA\x1C\"This amendment responds to an RFAI
    dated March 9, 2011. The RFAI inclludes 4 itemized issues. Each is addressed by
    number. (1) 30G Beginning Balance does not match 12G Closing Balance. The discrepancy
    has been resolved through amendments to both the 12G and 30G. (2) Line 8 Cash-on-hand
    for the period and the year do not match. The discrepancy has been resolved. (3)
    Negative Ending Balance. The Committee discovered a data entry error that caused
    all receipts from one of the Committee's contributions sources not to be reported.
    The Committee has corrected the data entry problem. The full details of the problem
    and its resolution are explained in the amended October Quarterly report. (4)
    48-Hour Notices do not match Report. The Committee regrets its oversight in failing
    to include the appropriate Schedule E entries on the report to match its correctly-filed
    October 14 48-Hour independent expenditure notice opposing Harry Reid and supporting
    Joe Heck. The Committee will endeavor to improve the reporting of Schedule E transactions
    on future reports.\"\n"
